import React from "react";

class Header extends React.Component {
  constructor(props) {
    super(props);
    this.state = { favoritecolor: "red" };
  }
  render() {
    return <h6>My Favorite Color is {this.state.favoritecolor}</h6>;
  }
}

class Buttons9a extends React.Component {
  render() {
    return (
      <>
        <button
          onClick={this.myClickHandler}
          name="red"
          style={{
            backgroundColor: "red",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.red}
        >
          Check I am red! <Header />
        </button>
        <button
          style={{
            backgroundColor: "blue",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.blue}
        >
          Check I am blue!
        </button>
        <button
          style={{
            backgroundColor: "Yellow",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.yellow}
        >
          Check I am Yellow!
        </button>
        <button
          style={{
            backgroundColor: "purple",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.purple}
        >
          Check I am purple!
        </button>
        <button
          style={{
            backgroundColor: "pink",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.pink}
        >
          Check I am pink!
        </button>
        <button
          style={{
            backgroundColor: "orange",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.orange}
        >
          Check I am orange!
        </button>
        <button
          style={{
            backgroundColor: "lightblue",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.lightblue}
        >
          Check I am lighblue!
        </button>
        <button
          style={{
            backgroundColor: "grey",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.grey}
        >
          Check I am grey!
        </button>
        <button
          style={{
            backgroundColor: "white",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.white}
        >
          Check I am white!
        </button>
      </>
    );
  }
}
export default Buttons9a;
